export default function App() {
  return (
    <>
      <Header />
      <Section />
    </>
  );
}

function Header() {
  return (
    <div className="Box">
      <div>
        <h2 className="top-text">New Item</h2>
        <form className="form">
          <input className="input" type="text" />
          <button className="button">Add</button>
        </form>
      </div>
    </div>
  );
}

function Section() {
  return (
    <div>
      <h2>ToDo List</h2>
      <label>
        <input type="checkbox" />
      </label>
    </div>
  );
}
